import React from 'react';

const Form = ({submitFn}) => (
    <form
        onSubmit={submitFn}
    >
        <input name="name"/>
        <input name="image"/>
        <input name="link"/>
        <textarea name="description"/>
        <button type="submit">Submit</button>
    </form>
)

export default Form;
